const App = () => {

	const [id, setId] = useState("");
	const [poster, setPoster] = useState("");

	return (
		<Router>
			<Routes>
				<Route path="/Main" setId={setId} setPoster={setPoster} element={<Main/>} />
			</Routes>
    	</Router>
	);
};

export default App;
